SELECT * FROM Unicorns;
SELECT Country,COUNT(*) AS n_companies
FROM unicorns 
GROUP BY Country
HAVING n_companies>20; -- a simple example of GROUP BY. Suppose we want to find the top ten countries with the highest number of Unicorn companies. 

SELECT Country, AVG(Valuation_USD_B) AS n_valuation
FROM unicorns
GROUP BY Country
ORDER BY n_valuation DESC
LIMIT 10; --  Calculate the Average Valuation by COUNTRY ðŸ’°

SELECT Category, ROUND(AVG(Valuation_USD_B)) AS n_valuationcat
FROM unicorns
GROUP BY Category
ORDER BY n_valuationcat DESC
LIMIT 10; --  Calculate the Average Valuation by Category ðŸ’°

CREATE TABLE Unicorns (
    id INT PRIMARY KEY,
    Company VARCHAR(255),
    Valuation_USD_B DECIMAL(10, 2),
    Date_Added DATE,
    Country VARCHAR(255),
    Category VARCHAR(255),
    Select_Investors TEXT
);

